  const Login = () => {
    const [change, setChange] = useState("");
    const [pass, setPass] = useState("");
    function inputChange(event) {
      setChange(event.target.value);
      console.log(event.target.value);
    }
    function passChange(event) {
      setPass(event.target.value);
      console.log(event.target.value);
    }
    return (
      <>
        <div className="head">
          <h1>Sign Up</h1>
        </div>
        <div className="body">
          <h3>UserName</h3>
          <input
            type="text"
            placeholder="enter User name"
            onChange={inputChange}
          />
          <h3>PassWord</h3>
          <input
            type="password"
            placeholder="enter password "
            onChange={passChange}
          />
        </div>
        const [status,setStat]=useState(false);

         function homep(){
            setStat(true)
            }
        {status === true ? <Home /> : <Login />}
        <button className="submit" onClick={homep}>
          Submit
        </button>
      </>
    );
  };

  return (
    <>

    </>
  );
}

export default App;
